import React from 'react';
import { Grid } from 'gymnast';
import { connect } from 'react-redux';
import Dataprint from './../_components/dataPrint';
import LessonDatas from '../_data/lessonData';
import DataPrints from './../_components/dataPrints';
import ModalGraph from '../_components/modalgraph'
import {rootConstants} from '../_constants';
const data11 = [];
const data22 = [];
const data33 = [];
const data44 = [];
const data55 = [];
class homeScreen extends React.Component {
    constructor() {
        super();
        this.handleClick = this.handleClick.bind(this);
        this.state = {
            data: {},
            data1: [],
            data2: [],
            data3: [],
            data4: [],
            data5: [],
            colors: 'white',
            colors1: 'green'

        }
     }
     componentDidMount() {


      for (var i = 0; i < LessonDatas.length; i++)
      {
            if(LessonDatas[i].level == 1 && LessonDatas[i].consumption != "МЭРГЭЖЛИЙН ХИЧЭЭЛ" ){
               data11.push(LessonDatas[i]);
            }
            if(LessonDatas[i].level == 2 && LessonDatas[i].consumption != "МЭРГЭЖЛИЙН ХИЧЭЭЛ" ){
               data22.push(LessonDatas[i]);
            }
            if(LessonDatas[i].level == 3 && LessonDatas[i].consumption != "МЭРГЭЖЛИЙН ХИЧЭЭЛ" ){
               data33.push(LessonDatas[i]);
            }
            if(LessonDatas[i].level == 4 && LessonDatas[i].consumption != "МЭРГЭЖЛИЙН ХИЧЭЭЛ" ){
               data44.push(LessonDatas[i]);
            }else{
               data55.push(LessonDatas[i]);
            }

      }

      this.setState({data1: data11, data2: data22, data3: data33, data4: data44, data5: data44,})


     }

     handleClick() {
      document.getElementsByClassName("102")[0].style.color = 'red';
      document.getElementsByClassName("cssss")[0].style.color = 'red';
     }
     render() {
        return (
         <Grid >  
            <Grid className="colsheader" size={12}> 
            <div className="cssss">asdasdas</div>
               <h1>
                  <button onClick={() => this.handleClick()}>asdasdasd</button>
               </h1>
               <h1>{this.props.counter}</h1>
               <h1>lol={this.props.graphLessonName}</h1>
            </Grid>

            <Grid className="colsheader" size={3}> <ModalGraph></ModalGraph><h1>1 Күрсийн үзвэл зохих хичээл</h1></Grid>
            <Grid className="colsheader" size={3}><h1>2 Күрсийн үзвэл зохих хичээл</h1></Grid>
            <Grid className="colsheader" size={3}><h1>3 Күрсийн үзвэл зохих хичээл</h1></Grid>
            <Grid className="colsheader" size={3}><h1>4 Күрсийн үзвэл зохих хичээл</h1></Grid>

            <Grid className="cols"  size={3} margin="2 2 2 0">
               {this.state.data1.map((person, i) => <Dataprint data={person}></Dataprint>)}
            </Grid>
            <Grid className="cols" size={3} margin="2 2 2 0">
               {this.state.data2.map((person, i) => <Dataprint data={person}></Dataprint>)}
            </Grid>
            <Grid className="cols" size={3} >
               {this.state.data3.map((person, i) => <Dataprint data={person}></Dataprint>)}
            </Grid>
            <Grid className="cols" size={3} >
               {this.state.data4.map((person, i) => <Dataprint data={person}></Dataprint>)}
            </Grid>

            <Grid className="colsheader" size={12}><h1>5 Күрсийн үзвэл зохих хичээл</h1></Grid>
            <Grid className="cols" size={12}>
               {this.state.data5.map((person, i) => <Dataprint data={person}></Dataprint>)}
            </Grid>


         </Grid>

        );
     }
}
function mapStateToProps(state) {
   return {
      lessonData: state.lessonData,
      counter: state.counter,
      islog: state.islog
   }
}
function mapDispatchToProps(dispatch) {
   return {
       increaseCounter: () => dispatch({type: rootConstants.ROOT_REQUEST }),
       decreaseCounter: () => dispatch({type: rootConstants.ROOT_SUCCESS }),
   }
}

export default connect(mapStateToProps,mapDispatchToProps)(homeScreen);
